import logo from "./logo.svg";
import "./App.css";
import { Avatar, Box, Container, Flex, Heading, MenuButton, MenuList } from "@chakra-ui/react";
import Navbar from "./Navigation/Navbar";

function App() {
  return (
    <Container>
      <Flex>
        <Navbar />
        <MenuButton><Avatar /></MenuButton>
        <MenuList>
          <MenuItem>Profile</MenuItem>
          <MenuItem>Sttings</MenuItem>
        </MenuList>
      </Flex>
    </Container>
  );
}

export default App;
